function Search(){
    return(
        <div className="row">
            <div className="col-md-12 d-flex">
                <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search"></input>
                <button className="btn btn-primary" >Search</button>
            </div>
        </div>
    );
}
export default Search;
